import React from 'react';
import "./Product.css";

const Product = ({product}) => {
  return (
    <div className='product col-md-6'>
        <p>{product.id}</p>
        <p>{product.name}</p>
        <p>{product.price}</p>
        
    </div>
  )
}

export default Product;
